import React from "react";
import ReactPlayer from "react-player";
const Trailer = (props) => {
  let youtubeUrl = `https://www.youtube.com/embed/${props.trailer}`;
  return (
    <div className="iframe">
      <ReactPlayer
        /* style={{ width: "580px", height: "350px" }}
        frameBorder="0"
        type="video/webm" */
        src={youtubeUrl}
      />
    </div>
  );
};

export default Trailer;
